    [],nt"num_tags": 8,nt"name": "wildlife-inventory-plan-des-lacs-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This wildlife inventory plan describes
    methods for collecting migratory birds, upland birds, big game, predator, and small
    mammal surveys at Des Lacs National Wildlife Refuge.  These methods have been developed
    as standard methods of inventory so year to year comparisons of data will be meaningful.
     Wildlife inventory procedures contain the location of surveys, man power needed,
    and initial survey instructions.  Inventory procedures are designed to provide a
    cost effective inventory of selected wildlife species and are integrated with other
    refuge wildlife management activities in order to provide information needed to
    more effectively manage trust resources.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
